import styled from 'styled-components';

export const SideBarStyled = styled.div`
	position: relative;
	display: flex;
	flex-direction: column;
	align-items: center;
	height: calc(100vh - 100px);
	top: 100px;
	width: 100%;
	padding: 10px;
	background-color: #1b3679;
`;
